import React from "react";
import { Login } from "./Login";
import { Chart } from "./Chart";
import { Bar } from "react-chartjs-2";
import sourceData from "./data/sourceData.json";
function App() {
  return (
    // <div>
    //   {/* <Login /> */}
    //   <Chart />
    // </div>
    <div className="smallChart customerCard">
      <Bar
        data={{
          labels: sourceData.map((data) => data.label),
          datasets: [
            {
              label: "Count",
              data: sourceData.map((data) => data.value),
              backgroundColor: [
                "rgba(255, 99, 132, 1)",
                "rgba(54, 162, 235, 1)",
                "rgba(255, 206, 86, 1)",
                "rgba(75, 192, 192, 1)",
              ],
              borderRadius: 10,
            },
          ],
        }}
      ></Bar>
    </div>
  );
}

export default App;
